import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Contact.css';

function Contact() {
  return (
    <div className="contact">
      <Header />
      <main>
        <h1>Contact Us</h1>
        <p>Get in touch with StreamFlix support.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Contact;
